import React from 'react';

const Navbar = ({scrollToAboutMe, scrollToPortfolio, scrollToContact}) => {
    return(
            <header className="fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
              <nav className="f6 fw6 ttu tracked">
                <p onClick = {scrollToAboutMe} className="link dim mid-gray dib mr3 pointer">about</p>
                <p onClick = {scrollToPortfolio} className="link dim mid-gray dib mr3 pointer">portfolio</p>
                <p onClick = {scrollToContact} className="link dim mid-gray dib mr3 pointer fr">contact</p>
              </nav>
            </header>
 );
}

export default Navbar;
